import React from 'react';
import { Link } from 'react-router-dom';

import Logo from '../Logo';
import Twist from './Twist';

import Nav from '../Nav';

import './Header.css';
import "./HeaderQueries.css";

const Header = () => {

  return (
    <header className="desktop flex f-col jc-start">
        <Link to="/">
          <Logo color="dark" />
        </Link>
        <Twist color="dark" />
        <Social />
        <Nav />
    </header>
  );
};

export default Header;
